static void
g_signal (GDBusProxy  *proxy,
          const gchar *sender_name,
          const gchar *signal_name,
          GVariant    *parameters)
{
  guint signal_id;
  signal_id = lookup_signal_id_from_signal_name (signal_name);
  switch (signal_id)
    {
    case __OBJECTS_ADDED_SIGNAL:
      {
        const gchar * const *arg_objects;
        g_variant_get (parameters,
                       "(^a&s)",
                       &arg_objects);
        g_signal_emit (proxy,
                       signals[signal_id],
                       0, arg_objects);
        g_free ((gpointer) arg_objects);
      }
      break;

    case __OBJECTS_MODIFIED_SIGNAL:
      {
        const gchar * const *arg_objects;
        g_variant_get (parameters,
                       "(^a&s)",
                       &arg_objects);
        g_signal_emit (proxy,
                       signals[signal_id],
                       0, arg_objects);
        g_free ((gpointer) arg_objects);
      }
      break;

    case __OBJECTS_REMOVED_SIGNAL:
      {
        const gchar * const *arg_ids;
        g_variant_get (parameters,
                       "(^a&s)",
                       &arg_ids);
        g_signal_emit (proxy,
                       signals[signal_id],
                       0, arg_ids);
        g_free ((gpointer) arg_ids);
      }
      break;

    case __PROGRESS_SIGNAL:
      {
        const gchar *arg_message;
        guint arg_progress;
        g_variant_get (parameters,
                       "(&su)",
                       &arg_message,
                       &arg_progress);
        g_signal_emit (proxy,
                       signals[signal_id],
                       0, arg_message, arg_progress);
      }
      break;

    case __DONE_SIGNAL:
      {
        guint arg_status;
        const gchar *arg_message;
        g_variant_get (parameters,
                       "(u&s)",
                       &arg_status,
                       &arg_message);
        g_signal_emit (proxy,
                       signals[signal_id],
                       0, arg_status, arg_message);
      }
      break;

    }
}

